import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { BusinessRoutingRoutingModule } from './business-routing-routing.module';
import { BusinessRoutingComponent } from './business-routing.component';


@NgModule({
  declarations: [
    BusinessRoutingComponent
  ],
  imports: [
    CommonModule,
    BusinessRoutingRoutingModule
  ]
})
export class BusinessRoutingModule { }
